    const scoresArr = []
    useEffect(()=>{
        viewScores()
    })
    const viewScores = () =>{
        Axios.get('/getallscores').then(r => {
            const scores = Object.values(r.data)
            scores.forEach((x)=>{
                scoresArr.push(x)
            })
            console.log(scoresArr)

        })
    }

        return (
            <div>
                <div className={"backg"}>
                    {
                        scoresArr.map((item) => (
                                <div>{item[0]}</div>
                            )
                        )
                    }
                </div>

                <button onClick={viewScores}>Click To View Scores</button>
            </div>
        )

}
